import React from "react";
import { VictoryArea, VictoryChart, VictoryAxis, VictoryStack } from 'victory';
import "./achievements.css";

const Achievements = () => {
    const allData = [
        { year: 2020, Ciencias: 5, Tecnología: 3, Arte: 2, Otras: 1 },
        { year: 2021, Ciencias: 7, Tecnología: 4, Arte: 3, Otras: 2 },
        // ... más datos ...
    ];

    return (
        <div className="achievements-container">
            <div className="achievements-banner">
                <h1>Logros y reconocimientos</h1>
                <p>Descubre nuestras destacadas contribuciones y logros.</p>
            </div>

            <div className="chart-container">
                <VictoryChart>
                    <VictoryAxis dependentAxis />
                    <VictoryAxis />
                    <VictoryStack>
                        <VictoryArea data={allData} x="year" y="Ciencias" />
                        <VictoryArea data={allData} x="year" y="Tecnología" />
                        <VictoryArea data={allData} x="year" y="Arte" />
                        <VictoryArea data={allData} x="year" y="Otras" />
                    </VictoryStack>
                </VictoryChart>
            </div>
        </div>
    );
}

export default Achievements;
